                                                <tr>
                                                    <th><strong>{t("Product")}</strong></th>
                                                    <th><strong>{t("Amount")}</strong></th>
                                                    <th><strong>{t("ParticipationBanesco")}</strong></th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                {data.dataMatrizCompetitiva.dataTablePosicion == null ? <tr key={1}>
                                                    <td colSpan="3" style={{ textAlign: 'center' }}><h5 className="card-title">{t("NoData")}</h5></td>
                                                </tr> : data.dataMatrizCompetitiva.dataTablePosicion.map((data) => (
                                                    <tr key={data.id}>
                                                        <td>{data.product}</td>
                                                        <td>${currencyData.format(data?.closeVol ?? 0)}</td>
                                                        <td>{data.participation}</td>
                                                    </tr>))}
                                            </tbody>
                                        </Table>
                                    </Row>
                                </CardBody>
                            </Card>
                        </Col>
                        <Col xl="12">
                            <Card>
                                <CardHeader>
                                    <h5 className="card-title">{t("BanescoTransactionalProducts")}</h5>
                                </CardHeader>
                                <CardBody>
                                    <Row>
                                        <Table className="table mt-1" responsive>
                                            <thead className="table-light">
                                                <tr>
                                                    <th><strong>{t("Product")}</strong></th>
                                                    <th><strong>{t("Amount")}</strong></th>
                                                    <th><strong>{t("ParticipationBanesco")}</strong></th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                {data.dataMatrizCompetitiva.dataTableTransaccion == null ? <tr key={1}>
