                                                        <td>{data.participation}</td>
                                                    </tr>))}
                                            </tbody>
                                        </Table>
                                    </Row>
                                </CardBody>
                            </Card>
                        </Col>
                    </Row>
                    <Row>
                        <Col xl="12">
                            <Card>
                                <CardHeader>
                                    <h5 className="card-title">{t("OtherBanksLiabilitiesAssets")}</h5>
                                </CardHeader>
                                <CardBody>
                                    <Row>
                                        <Table className="table mt-1" responsive>
                                            <thead className="table-light">
                                                <tr>
                                                    <th><strong>{t("Bank")}</strong></th>
                                                    <th><strong>{t("Passive")}</strong></th>
                                                    <th><strong>{t("Participation")}</strong></th>
                                                    <th><strong>{t("LongTerm")}</strong></th>
                                                    <th><strong>{t("ShortTerm")}</strong></th>
                                                    <th><strong>{t("Total")}</strong></th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                {data.dataMatrizCompetitiva.dataTableOtrosBancosActivosFijos == null ? <tr key={1}>
                                                    <td colSpan="3" style={{ textAlign: 'center' }}><h5 className="card-title">{t("NoData")}</h5></td>
                                                </tr> : data.dataMatrizCompetitiva.dataTableOtrosBancosActivosFijos.map((data) => (
                                                    <tr key={data.id}>
                                                        <td>{data.bank}</td>
                                                        <td>{data.passivePercentage}</td>
                                                        <td>{data.participation}</td>
                                                        <td>${currencyData.format(data?.longTerm ?? 0)}</td>
                                                        <td>${currencyData.format(data?.shortTerm ?? 0)}</td>
                                                        <td>{data.bank + data.passivePercentage + data.participation + data.longTerm + data.shortTerm}</td>
                                                    </tr>))}
                                            </tbody>
                                        </Table>
                                    </Row>
                                </CardBody>
                            </Card>
                        </Col>
                        <Col xl="12">
                            <Card>
                                <CardHeader>
                                    <h5 className="card-title">{t("ProfitabilityMatrix")}</h5>
                                </CardHeader>
                                <CardBody>
                                    <Row>
                                        <Table className="table mt-1" responsive>
                                            <thead className="table-light">
                                                <tr>
                                                    <th><strong>{t("Type")}</strong></th>
                                                    <th><strong>{t("Quantity")}</strong></th>
                                                </tr>
                                            </thead>
                                            <tbody>
                                                {data.dataMatrizCompetitiva.dataTableRentabilidad == null ? <tr key={1}>
                                                    <td colSpan="3" style={{ textAlign: 'center' }}><h5 className="card-title">{t("NoData")}</h5></td>
                                                </tr> : data.dataMatrizCompetitiva.dataTableRentabilidad.map((data) => (
                                                    <tr key={data.id}>
                                                        <td>{data.matrixType.code}</td>
                                                        <td>{data.quantity}</td>
                                                    </tr>))}
                                            </tbody>
                                        </Table>
                                    </Row>
                                </CardBody>
                            </Card>
                        </Col>

                    </Row>
                    <Row>
                        <Col xl="12">
                            <Card>
                                <CardHeader>
                                    <h5 className="card-title">{t("NewBusinessesCommitments")}</h5>
                                </CardHeader>
                                <CardBody>
                                    <Row>
                                        <Table className="table mt-1" responsive>
